import React from 'react';
import './Roadmap.css'
import { roadmap } from '../../../../images/roadmap.jpg'

const Roadmap = () => {
    return (
        <div className='roadmap'>
            <img src={roadmap} alt="" />
        </div>
    );
}

export default Roadmap;
